pragma solidity ^0.8.19;

interface IDeveloperPayouts {
    // Events
    event BountyClaimed(uint256 indexed issueId, address indexed developer);
    event PayoutProcessed(uint256 indexed issueId, address indexed developer, uint256 amount);
    event ClaimCancelled(uint256 indexed issueId, address indexed developer);

    // Functions
    function claimBounty(uint256 issueId) external;
    function processPayout(uint256 issueId) external;
    function cancelClaim(uint256 issueId) external;
    function getClaimStatus(uint256 issueId) external view returns (bool claimed, address developer, uint256 amount);
     function fundManager() external view returns (address);
}

// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

interface IValidatorMultiSig {
    // Events
    event ValidatorAdded(address indexed validator);
    event ValidatorRemoved(address indexed validator);
    event PayoutApproved(uint256 indexed issueId, address indexed developer);
     event ApprovalRevoked(uint256 indexed issueId, address indexed developer);

    // Functions
    function addValidator(address validator) external;
    function removeValidator(address validator) external;
    function approvePayment(uint256 issueId, address developer) external;
    function revokeApproval(uint256 issueId, address developer) external;
    function isApproved(uint256 issueId, address developer) external view returns (bool);
    function getApprovalCount(uint256 issueId, address developer) external view returns (uint256);
    function getValidators() external view returns (address[] memory);
}

// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

interface IFundManager {
    // Events
    event FundsDeposited(address indexed funder, uint256 amount);
    event BountyAllocated(uint256 indexed issueId, uint256 amount);
    event FundsReallocated(uint256 indexed fromIssue, uint256 indexed toIssue, uint256 amount);
    event BountyCancelled(uint256 indexed issueId);

    // Functions
    function depositFunds() external payable;
    function allocateBounty(uint256 issueId, uint256 amount) external;
    function reallocateFunds(uint256 fromIssue, uint256 toIssue, uint256 amount) external;
    function getIssueBounty(uint256 issueId) external view returns (uint256);
    function getFunderBalance(address funder) external view returns (uint256);
    function getBountyDetails(uint256 issueId) external view returns (
        uint256 amount,
        address funder,
        uint256 createdAt,
        bool active
    );
}

